import React from 'react';

export default function SearchComponent() {
  return (
    <>
    <div className='sear'>
      <span>Search</span>
      <div>
        <div className='form-group'>
          <label>
            <input type='email' name='email' className='Input' /> <p />
          </label>
        </div>
      </div>
      </div>
    </>
  );
}
